import Head from "next/head";
import Image from "next/image";
import Link from "next/link";
import { useHistory } from "react-router-dom";
import React, { useLayoutEffect, useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";
import { Pagination, Navigation } from "swiper/modules";
import Select from 'react-dropdown-select';
import { AiOutlineArrowLeft } from "react-icons/ai";
import {
  Footer,
} from "@/components";

function DownSide(props) {
  const [propertyType, setPropertyType] = useState("Rooms");
  const [buttons, setButtons] = useState({ prev: false, next: true });
  const listRef = useRef(null);
  const onScroll = (e) => {
    const { scrollLeft, scrollWidth } = e.target;
    setButtons({
      prev: scrollLeft > 0,
      next: scrollLeft + listRef.current?.clientWidth < scrollWidth,
    });
  };
  return (
    <div className="downside">
      <div></div>
      <div className="list center">
        {/* {buttons.prev && (
          <span className="prev">
            <button
              onClick={() =>
                (listRef.current.scrollLeft -=
                  listRef.current?.clientWidth * 0.8)
              }
            >
              <PrevIcon />
            </button>
          </span>
        )} */}
        <ul className="center" ref={listRef} onScroll={onScroll}>
          {props.filterItems.map((obj, index) => {
            return (
              <li
                className={obj.title == propertyType && "active"}
                onClick={() => setPropertyType(obj.title)}
                key={index}
              >
                <Image alt="" src={obj.imageUrl} width={24} height={24} />
                <p>{obj.title}</p>
              </li>
            );
          })}
        </ul>
        {/* {buttons.next && (
          <span className="next">
            <button
              onClick={() =>
                (listRef.current.scrollLeft +=
                  listRef.current?.clientWidth * 0.8)
              }
            >
              <NextIcon />
            </button>
          </span>
        )} */}
      </div>
      {/* <button className="filter">
        <FilterIcon />
        <p>Filters</p>
      </button> */}
    </div>
  );
}

const Home = ({ data }) => {
  const history = useHistory();

  useLayoutEffect(() => {
    const worker = () =>
      document
        .querySelector("header")
        ?.classList.toggle("up", window.scrollY > 0);
    window.addEventListener("scroll", worker);
    return () => window.removeEventListener("scroll", worker);
  }, []);

  const [salesType, setSalesType] = useState("For sale");
  const [searchKeywords, setSearchKeywords] = useState([]);
  const [isSearch, setIsSearch] = useState(false);
  

  const linkNormalizer = (url: String) => {
    if (!url) return "";
    var link = url.toLowerCase();
    link = link.replaceAll(" ", "-");

    return link;
  }

  return (
    <>
      <div className="home">
        <Head>
          <title>MCDream - Kogi state</title>
        </Head>
        <header>
          <div className="upside">
            <Link className="logo" href={"/"}>
              <Logo />
              <span className="logoicon-name">MCDream </span>
              {/* <MiniLogo /> */}
            </Link>
            <div className={!isSearch ? "middle" : "middle middle-long"}>
              {isSearch && (
                <button
                  className="button-left"
                  onClick={() => setIsSearch(false)}
                >
                  <AiOutlineArrowLeft />
                </button>
              )}
              {!isSearch && (
                <>
                  <p
                    className={salesType == "For sale" ? "" : "l"}
                    onClick={() => setSalesType("For sale")}
                  >
                    For sale
                  </p>
                  {/* <p className="m">For rent</p> */}
                  <p
                    className={salesType == "For rent" ? "ml" : "ml l"}
                    onClick={() => setSalesType("For rent")}
                  >
                    For rent
                  </p>
                </>
              )}
              {isSearch && (
                <div className="pl-0">
                  <Select
                    clearable={true}
                    searchable={true}
                    dropdownHandle={false}
                    options={data.sections.places}
                    values={searchKeywords}
                    searchBy={"name"}
                    labelField="name" 
                    valueField="name"
                    placeholder={"Search location"}
                    
                    onChange={(values) => setSearchKeywords(values)}
                    style={{ width: "290px" }}
                    className="block w-full rounded-md border-0 py-1.5 pl-2 pr-20 text-gray-900 ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:text-sm sm:leading-6 search-select"
                    
                  />
                </div>
              )}
              <button
                className="button-right"
                onClick={() => setIsSearch(true)}
              >
                <SearchIcon />
              </button>
            </div>
            <div className="right">
              {/* <button className="ayh">Kogi your home</button>
              <button className="global">
                <GlobalIcon />
              </button> */}
              <button className="a">
                <MenuIcon />
                <PersonIcon />
              </button>
            </div>
          </div>
          <DownSide
            filterItems={data.sections.sections[0].section.filterItems}
          />
        </header>
        <ul className="items">
          {data.sections.sectionIndependentData.staysSearch.searchResults.map(
            (result, index) => {
              return (
                <li key={index}>
                  <Link 
                   href={`/${linkNormalizer(result.listing.name)}`}
                  // onClick={(ev) => {
                  //   ev.preventDefault();
                  //   history.push(`/${linkNormalizer(result.listing.name)}`, { params: { property: result} });
                  // }}
                  >
                    <div className="images">
                      <Swiper
                        modules={[Navigation, Pagination]}
                        slidesPerView={1}
                        pagination={{
                          clickable: true,
                          dynamicBullets: true,
                          dynamicMainBullets: 8,
                        }}
                        navigation={{
                          nextEl: `.swiper-button-nextx${result.listing.id}`,
                          prevEl: `.swiper-button-prevx${result.listing.id}`,
                        }}
                        allowTouchMove={false}
                      >
                        {result.listing.contextualPictures.map((picture, _index) => {
                          return (
                            <SwiperSlide key={_index}>
                              <Image
                                src={picture.picture}
                                width={500}
                                height={500}
                              />
                            </SwiperSlide>
                          );
                        })}
                      </Swiper>
                      <button
                        onClick={(e) => {
                          e.preventDefault();
                          e.stopPropagation();
                        }}
                        className={`swiper-button-prevx${result.listing.id} btnn prev`}
                      >
                        <PrevIcon />
                      </button>{" "}
                      <button
                        onClick={(e) => {
                          e.preventDefault();
                          e.stopPropagation();
                        }}
                        className={`swiper-button-nextx${result.listing.id} btnn next`}
                      >
                        <NextIcon />
                      </button>
                    </div>
                    <div className="text">
                      <div className="up">
                        <p className="city">{result.listing.city}</p>
                        <div className="rate">
                          <StarIcon />
                          <p>{result.listing.avgRatingLocalized}</p>
                        </div>
                      </div>
                      <div className="view">
                        {
                          result.listing.structuredContent.mapCategoryInfo[0]
                            .body
                        }
                      </div>
                      {/* <div className="date">
                        {
                          result.listing.structuredContent.mapSecondaryLine[0]
                            .body
                        }
                      </div> */}
                      <div className="price">
                        <span>
                          {
                            result.pricingQuote.structuredStayDisplayPrice
                              .primaryLine.price
                          }{" "}
                        </span>
                        night
                      </div>
                    </div>
                  </Link>
                </li>
              );
            }
          )}
        </ul>
      </div>
      <Footer />
    </>
  );
};

export default Home;

export const getServerSideProps = () =>
  fetch(
    (process.env.NODE_ENV === "production"
      ? process.env.URL
      : "http://localhost:3000") +
      "/api" +
      "/home",
    {
      next: {
        revalidate: 60,
      },
    }
  )
    .then((r) => r.json())
    .then((r) => ({ props: { data: r } }));

